import "@uniswap/v3-periphery/contracts/libraries/TransferHelper.sol";

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

contract PiggySwap is OwnableUpgradeable {
    address             feeReceiver;
    IUniswapV2Router02  public routerV2;
    ISwapRouter         public routerV3;
    address             public WETH;
    uint                public feePercentage;

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
        // feeReceiver = receiver;
    }

    function initialize(address receiver) initializer public {
        __Ownable_init(msg.sender);
        feeReceiver = receiver;
        feePercentage = 100; // 0.1%
    }

    /**
     * V1 Router functions
     */
    
    function swapETHForExactTokens(
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external payable {
        uint256 fee = msg.value * feePercentage / 1000;
        TransferHelper.safeApprove(path[0], address(routerV2), msg.value - fee);
        routerV2.swapETHForExactTokens{value: msg.value - fee}(amountOutMin, path, to, deadline);
        _clearETH();
    }

    /**
     * V2 Router functions
     */

    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external {
        uint256 balanceBefore = IERC20(path[0]).balanceOf(address(this));
        TransferHelper.safeTransferFrom(path[0], msg.sender, address(this), amountIn);
        uint256 amount = IERC20(path[0]).balanceOf(address(this)) - balanceBefore;
        uint256 amountTaxed = amount - (amount * feePercentage / 1000);
        assert(amountTaxed < amountIn);
        TransferHelper.safeApprove(path[0], address(routerV2), amountTaxed);
        routerV2.swapExactTokensForTokensSupportingFeeOnTransferTokens(amountTaxed, amountOutMin, path, to, deadline);
        _clearToken(path[0]);
    }

    function swapExactETHForTokensSupportingFeeOnTransferTokens(
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external payable {
        uint256 fee = msg.value * feePercentage / 1000;
        TransferHelper.safeApprove(path[0], address(routerV2), msg.value - fee);
        routerV2.swapExactETHForTokensSupportingFeeOnTransferTokens{value: msg.value - fee}(amountOutMin, path, to, deadline);
        _clearETH();
    }

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external {
        uint256 balanceBefore = address(this).balance;
        TransferHelper.safeTransferFrom(path[0], msg.sender, address(this), amountIn);
        TransferHelper.safeApprove(path[0], address(routerV2), amountIn);
        routerV2.swapExactTokensForETHSupportingFeeOnTransferTokens(amountIn, amountOutMin, path, address(this), deadline);
        uint256 balance = address(this).balance - balanceBefore;
        TransferHelper.safeTransferETH(to, balance - (balance * feePercentage / 1000));
        _clearETH();
    }

    function quote(
        uint amountIn,
        address[] calldata path
    ) external view returns (uint amount) {
        uint[]memory outputs = routerV2.getAmountsOut(amountIn, path);
        return outputs[outputs.length - 1];
    }

    /**
     * V3 Router functions
     */

    function uniswapV3SwapCallback(
        int256 amount0Delta,
        int256 amount1Delta,
        bytes calldata data
    ) external {}

    function exactInputSingle(
        ISwapRouter.ExactInputSingleParams calldata params
    ) external payable returns (uint256 amountOut) {}

    function exactInput(
        ISwapRouter.ExactInputParams calldata params
    ) external payable returns (uint256 amountOut) {}

    function exactOutputSingle(
        ISwapRouter.ExactOutputSingleParams calldata params
    ) external payable returns (uint256 amountIn) {}

    function exactOutput(
        ISwapRouter.ExactOutputParams calldata params
    ) external payable returns (uint256 amountIn) {}

    /**
     * Owner functions
     */

    function setFeePercentage(uint value) public onlyOwner {
        feePercentage = value;
    }
    
    function setRouterV2(address router) public onlyOwner {        
        routerV2    = IUniswapV2Router02(router);
        WETH        = routerV2.WETH();
    }

    function setRouterV3(address router) public onlyOwner {        
        routerV3    = ISwapRouter(router);
    }
    
    function clearETH() public onlyOwner {
        _clearETH();
    }

    function clearToken(address token) public onlyOwner {
        _clearToken(token);
    }

    /**
     * Internal functions
     */

    function _clearETH() internal {
        uint256 balance = address(this).balance;
        if(balance > 0){
            (bool success,) = payable(feeReceiver).call{value: balance}("");
            require(success, "PiggySwap: ETH_TRANSFER_FAILED");
        }
    }

     function _clearToken(address token) internal {
        uint256 balance = IERC20(token).balanceOf(address(this));
        if(balance > 0){
            bool success = IERC20(token).transfer(feeReceiver, balance);
            require(success, "PiggySwap: TOKEN_TRANSFER_FAILED");
        }
    }
    
    receive() external payable { }
}"
    }
  },
  "settings": {
    "optimizer": {
      "enabled": true,
      "runs": 1337
    },
    "evmVersion": "paris",
    "outputSelection": {
      "*": {
        "*": [
          "evm.bytecode",
          "evm.deployedBytecode",
          "devdoc",
          "userdoc",
          "metadata",
          "abi"
        ]
      }
    },
    "libraries": {}
  }
}}
